import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function App() {
  return (
    <>
    <Router>
      <Switch>
        <Route path="/pizza">
          <Main />
        </Route>

        <Route path="/" exact>
          <Home />
        </Route>

        <Route path="/success" exact>
          <Success />
        </Route>
      </Switch>
    </Router>


  </>
  );
}

export default App;
